(30, 2, 'Torso Parts', '6724ef366fe6c-torso-parts', '1kg Pack of Cow Special Parts', 'Our premium Cow Torso Part is a versatile cut, perfect for a variety of dishes. Expertly butchered and sourced from high-quality beef, this cut is ideal for slow-cooking, roasting, or grilling. Enjoy the rich, succulent flavor and tender texture that will elevate your meals.\r\n\r\n- Weight:** Approx. X lbs/kg\r\n- Cut: Torso and cut with skin\r\n- Quality: Premium, grass-fed\r\n\r\nAdd this to your cart today and experience the taste of quality beef!', '670f582ae3956.png', 0, 6500, '', NULL, 50, 'Cow Torso', 'Torso cut, special part', 'Our premium Cow Torso Part is a versatile cut, perfect for a variety of dishes. Expertly butchered and sourced from high-quality beef, this cut is ideal for slow-cooking, roasting, or grilling. Enjoy the rich, succulent flavor and tender texture that will elevate your meals.\r\n\r\n- Weight:** Approx. X lbs/kg\r\n- Cut: Torso and cut with skin\r\n- Quality: Premium, grass-fed\r\n\r\nAdd this to your cart today and experience the taste of quality beef!', 'Support Services', 0, 0, 0, '2024-10-16 07:07:38'),
(31, 2, 'Muscle Part ', '6724ef142536a-muscle-part', '1kg of Cow Special Parts', 'Discover the rich, flavorful taste of our premium Cow Muscle Part. Sourced from high-quality, grass-fed cattle, this cut is perfect for slow-cooking, grilling, or braising. Whether you\'re preparing a hearty stew or a savory roast, our Cow Muscle Part delivers tenderness and deliciousness in every bite. Elevate your meals with this versatile and nutritious choice. Order now and experience the difference in quality and taste!', '670f58f040ec7.png', 0, 6500, '', NULL, 50, 'Muscle Part ', 'Cow Muscle parts', 'Discover the rich, flavorful taste of our premium Cow Muscle Part. Sourced from high-quality, grass-fed cattle, this cut is perfect for slow-cooking, grilling, or braising. Whether you\'re preparing a hearty stew or a savory roast, our Cow Muscle Part delivers tenderness and deliciousness in every bite. Elevate your meals with this versatile and nutritious choice. Order now and experience the difference in quality and taste!\r\n\r\n', 'Support Services', 0, 0, 0, '2024-10-16 07:10:56'),
(32, 2, 'Fish Meat Parts', '6724eea24af70-fish-meat-parts', '1kg of Cow Special Parts', 'Discover the rich, flavorful taste of our premium Cow Fish Meat Part. Perfectly cut and prepared, this versatile meat is ideal for a variety of dishes, from hearty stews to delicious grilled entrees. Sourced from the finest quality beef, our Cow Fish Meat Part ensures a tender and juicy experience in every bite. Elevate your meals with this high-quality, protein-packed ingredient. \r\n', '670f598c836ca.png', 0, 6500, '', NULL, 50, 'Fish meat', 'Fish meat part', 'Discover the rich, flavorful taste of our premium Cow Fish Meat Part. Perfectly cut and prepared, this versatile meat is ideal for a variety of dishes, from hearty stews to delicious grilled entrees. Sourced from the finest quality beef, our Cow Fish Meat Part ensures a tender and juicy experience in every bite. Elevate your meals with this high-quality, protein-packed ingredient. \r\n', 'Support Services', 0, 0, 0, '2024-10-16 07:13:32'),
(33, 2, 'Cow Assorted Parts (Offals)', '670f5bdc0e62d-cow-assorted-parts-offals', '1kg Pack of Cow Special Parts ', 'Discover the rich flavors and unique textures of our Cow Assorted Part (Offal). Sourced from high-quality, grass-fed cows, this selection includes a variety of nutritious and delicious offal parts such as liver, heart, kidney, and tripe. Perfect for traditional recipes or adventurous culinary creations, our cow offal promises freshness and quality with every bite. Ideal for those who appreciate the nose-to-tail approach to cooking.\r\n\r\n', '670f5bdc0e69f.png', NULL, 5500, NULL, NULL, 50, 'Cow Assorted ', 'Cow Offals, Cow Assorted ', 'Discover the rich flavors and unique textures of our Cow Assorted Part (Offal). Sourced from high-quality, grass-fed cows, this selection includes a variety of nutritious and delicious offal parts such as liver, heart, kidney, and tripe. Perfect for traditional recipes or adventurous culinary creations, our cow offal promises freshness and quality with every bite. Ideal for those who appreciate the nose-to-tail approach to cooking.\r\n\r\n', 'Support Services', 0, 0, 0, '2024-10-16 07:23:24'),
(34, 9, 'Kilishi ', '671a9faaa7cf9-kilishi', 'Spicy and Meaty Kilishi ', 'Nigerian beef jerky, is made from thinly sliced, high-quality beef that is marinated in a special blend of spices and herbs, then slowly dried to perfection. Each bite offers a tantalizing combination of smoky, spicy, and slightly sweet notes that will leave you craving more. Perfect as a snack, appetizer, or protein-packed treat, Kilishi is a delicious way to enjoy a taste of authentic Nigerian cuisine. Savor the taste of tradition with every bite.\r\n\r\n', '6714c65b6f7bd.jpg', 0, 3000, ' ₦3000-  ₦28,000', NULL, 48, 'Kilishi ', 'Kilishi ', 'Nigerian beef jerky, is made from thinly sliced, high-quality beef that is marinated in a special blend of spices and herbs, then slowly dried to perfection. Each bite offers a tantalizing combination of smoky, spicy, and slightly sweet notes that will leave you craving more. Perfect as a snack, appetizer, or protein-packed treat, Kilishi is a delicious way to enjoy a taste of authentic Nigerian cuisine. Savor the taste of tradition with every bite.\r\n\r\n', 'Support Services', 0, 1, 0, '2024-10-20 09:53:43'),
(35, 2, 'Cow Tongue ', '671c81d3409c3-cow-tongue', '1.5kg Portion of Cow Tongue ', 'Our premium-quality cow tongue is carefully cleaned and prepared, offering a rich, tender texture and a unique, savory flavor. Perfect for various traditional and gourmet dishes, this cow tongue is ideal for slow cooking, grilling, or braising. Fresh and flavorful, it\'s a versatile choice for creating hearty, delicious meals.', '671c81d340abb.png', 7000, 10000, '', 'DMY-440fe1g8brf0ut88036sm71b6tjr8', 50, 'Cow Tongue ', 'Cow meat, Cow Tongue ', 'Our premium-quality cow tongue is carefully cleaned and prepared, offering a rich, tender texture and a unique, savory flavor. Perfect for various traditional and gourmet dishes, this cow tongue is ideal for slow cooking, grilling, or braising. Fresh and flavorful, it\'s a versatile choice for creating hearty, delicious meals.', 'Support Services', 0, 0, 0, '2024-10-26 06:44:51'),
(36, 2, 'Cow Head', '671c82d5a711b-cow-head', 'Whole Cow Head (5.5kg)', 'Get the rich flavor and unique texture of our premium cow head, perfect for traditional dishes like Isi Ewu, pepper soup, or as a delicious addition to various recipes. Carefully cleaned and prepared, our cow head meat is fresh, high-quality, and ready to bring authentic taste to your meals. Ideal for those who appreciate bold flavors and hearty ingredients.\r\n', '671c82d5a7185.png', 30000, 35000, ' ₦17,500 -  ₦35,000', 'DMY-647fe1g8brf0ut88036sm71b6tjr8', 50, 'Cow head', 'Cow head', 'Get the rich flavor and unique texture of our premium cow head, perfect for traditional dishes like Isi Ewu, pepper soup, or as a delicious addition to various recipes. Carefully cleaned and prepared, our cow head meat is fresh, high-quality, and ready to bring authentic taste to your meals. Ideal for those who appreciate bold flavors and hearty ingredients.\r\n', 'Support Services', 0, 0, 0, '2024-10-26 06:49:09'),
(37, 2, 'Cow Legs ', '671c83d11ed19-cow-legs', 'Cow leg per Pair', 'Our fresh Cow Leg is perfect for adding rich, flavorful depth to traditional soups and stews. Known for its tenderness and collagen, cow leg meat is a favorite for making hearty dishes that are both nutritious and delicious. Carefully cleaned and prepared for your convenience, it\'s an ideal choice for creating authentic, slow-cooked meals that everyone will enjoy.', '671c83d11ed9c.png', 5000, 6000, '', 'DMY-363fe1g8brf0ut88036sm71b6tjr8', 50, 'Cow Legs ', 'Cow leg', 'Our fresh Cow Leg is perfect for adding rich, flavorful depth to traditional soups and stews. Known for its tenderness and collagen, cow leg meat is a favorite for making hearty dishes that are both nutritious and delicious. Carefully cleaned and prepared for your convenience, it\'s an ideal choice for creating authentic, slow-cooked meals that everyone will enjoy.\r\n\r\n', 'Support Services', 0, 0, 0, '2024-10-26 06:53:21'),
(38, 2, 'Cow Brisket Bones ', '671c8467cae45-cow-brisket-bones', 'Brisket Bones Per Kilo', 'Our Cow Brisket Bones are perfect for adding rich flavor to soups, stews, and broths. Sourced from high-quality, grass-fed cows, these meaty bones offer a hearty taste and are ideal for slow cooking to release their full, savory essence. Enjoy the natural goodness and depth of flavor that only brisket bones can bring to your dishes.', '671c8467caeb7.png', 2500, 3500, '', 'DMY-762fe1g8brf0ut88036sm71b6tjr8', 50, 'Brisket bone ', 'Brisket bone', 'Our Cow Brisket Bones are perfect for adding rich flavor to soups, stews, and broths. Sourced from high-quality, grass-fed cows, these meaty bones offer a hearty taste and are ideal for slow cooking to release their full, savory essence. Enjoy the natural goodness and depth of flavor that only brisket bones can bring to your dishes.', 'Support Services', 0, 0, 0, '2024-10-26 06:55:51'),
(39, 2, 'Cow Meat sharing', '6724edd287ac4-cow-meat-sharing', 'Agemawo Cow Meat share', ' Enjoy fresh, high-quality cow meat with our Cow Meat Share package. Perfectly portioned and sourced from healthy, well-raised cattle, this selection provides a variety of cuts ideal for family meals, special occasions, or meal prep. Our Cow Meat Share is freshly prepared and packaged to retain its natural flavor and tenderness, ensuring a delicious and satisfying experience in every bite.', '671c95540f79a.jpg', 38000, 45000, ' ₦11,300 -  ₦112,500', NULL, 50, 'Cow meat share ', 'Cow meat ', 'Enjoy fresh, high-quality cow meat with our Cow Meat Share package. Perfectly portioned and sourced from healthy, well-raised cattle, this selection provides a variety of cuts ideal for family meals, special occasions, or meal prep. Our Cow Meat Share is freshly prepared and packaged to retain its natural flavor and tenderness, ensuring a delicious and satisfying experience in every bite.', 'Support Services', 0, 0, 0, '2024-10-26 07:10:57'),
(40, 2, 'Cow Boneless slot (Agemawo)', '672a9c53345ca-cow-boneless-slot-agemawo', 'Without offal and Bones ', 'Enjoy premium-quality, boneless cow meat with the richness of skin intact. Perfectly cut for convenience, this meat is ideal for a variety of dishes, adding a delicious depth of flavor and texture. Fresh, tender, and ready to cook, our cow boneless share offers a tasty option for stews, soups, and grilled recipes.\r\n', '671c925a11ffd.jpg', 0, 16000, '', NULL, 49, 'Cow Boneless meat', 'Cow meat', ' Enjoy premium-quality, boneless cow meat with the richness of skin intact. Perfectly cut for convenience, this meat is ideal for a variety of dishes, adding a delicious depth of flavor and texture. Fresh, tender, and ready to cook, our cow boneless share offers a tasty option for stews, soups, and grilled recipes.', 'Support Services', 0, 0, 0, '2024-10-26 07:47:40'),
(41, 2, 'Cow Tail ', '671eb349a5251-cow-tail', 'Complete Cow Tail (4.5kg)', 'Our premium Cow Tail is a rich and flavorful cut, perfect for hearty soups, stews, and traditional dishes. Known for its tender, succulent texture when slow-cooked, this cut adds depth and deliciousness to any meal. Freshly sourced and carefully processed, our Cow Tail is ideal for bringing authentic taste to your kitchen.\r\n\r\n\r\n\r\n', '671c96ebe126b.png', 0, 25000, '', NULL, 50, 'Cow tail', 'Cow tail ', 'Our premium Cow Tail is a rich and flavorful cut, perfect for hearty soups, stews, and traditional dishes. Known for its tender, succulent texture when slow-cooked, this cut adds depth and deliciousness to any meal. Freshly sourced and carefully processed, our Cow Tail is ideal for bringing authentic taste to your kitchen.', 'Support Services', 0, 0, 0, '2024-10-26 08:06:13'),
(42, 2, 'Goat Head', '671c9a3c795bc-goat-head', 'Complete Goat Head', 'Our premium cow head is carefully sourced and prepared to bring rich flavor and texture to traditional dishes. Perfect for making delicious soups, stews, and other hearty meals, this cow head meat is fresh, well-cleaned, and ready for cooking. Enjoy the authentic taste and unique quality that enhances every bite.\r\n', '671c9a3c79634.png', 0, 4500, '6000', 'DMY-3813nf9a6s1837kgbo2dg4qvni39u', 50, 'Goat head', 'Goat head', 'Our premium cow head is carefully sourced and prepared to bring rich flavor and texture to traditional dishes. Perfect for making delicious soups, stews, and other hearty meals, this cow head meat is fresh, well-cleaned, and ready for cooking. Enjoy the authentic taste and unique quality that enhances every bite.', 'Support Services', 0, 0, 0, '2024-10-26 08:29:00'),
(43, 5, 'Oven Dried Catfish (Folded)', '671c9cf35f5c4-oven-dried-catfish-folded', 'Medium size Catfish (Degutted)', 'Savor the rich, smoky flavor of our Oven-Dried Catfish, expertly folded for easy handling and versatile use. Each piece is meticulously degutted and dried to preserve its natural taste and texture, making it perfect for soups, stews, or enjoyed as a snack. Rich in protein and packed with nutrients, this delicious catfish is an ideal choice for health-conscious consumers seeking authentic, high-quality seafood. ', '671c9cf35f637.jpeg', 11000, 20000, ' ₦19,000 -  ₦95,000', 'DMY-2473nf9a6s1837kgbo2dg4qvni39u', 50, 'Oven dried catfish ', 'Catfish ', 'Savor the rich, smoky flavor of our Oven-Dried Catfish, expertly folded for easy handling and versatile use. Each piece is meticulously degutted and dried to preserve its natural taste and texture, making it perfect for soups, stews, or enjoyed as a snack. Rich in protein and packed with nutrients, this delicious catfish is an ideal choice for health-conscious consumers seeking authentic, high-quality seafood. ', 'Support Services', 0, 0, 0, '2024-10-26 08:40:35'),
(44, 5, 'Oven dried Catfish (cutlets)', '671ca0637c46f-oven-dried-catfish-cutlets', 'Head and Tail inclusives ', 'Savor the rich, smoky flavor of our Oven-Dried Catfish, expertly folded for easy handling and versatile use. Each piece is meticulously degutted and dried to preserve its natural taste and texture, making it perfect for soups, stews, or enjoyed as a snack. Rich in protein and packed with nutrients, this delicious catfish is an ideal choice for health-conscious consumers seeking authentic, high-quality seafood. ', '671ca0637c4d2.jpg', 20000, 25000, ' ₦25,000 -  ₦115,000', NULL, 47, 'Catfish cutlets ', 'Catfish cutlets, Catfish cutcut', 'Savor the rich, smoky flavor of our Oven-Dried Catfish, expertly folded for easy handling and versatile use. Each piece is meticulously degutted and dried to preserve its natural taste and texture, making it perfect for soups, stews, or enjoyed as a snack. Rich in protein and packed with nutrients, this delicious catfish is an ideal choice for health-conscious consumers seeking authentic, high-quality seafood. ', 'Support Services', 0, 0, 0, '2024-10-26 08:50:49'),
(45, 5, 'Oven Dried Panla Fish ', '671eac68cda5c-oven-dried-panla-fish', 'Spiced and Degutted Eja kika', 'Experience the rich, savory flavor of our oven-dried panla fish, expertly prepared for the perfect balance of taste and texture. Each fish is carefully selected and dried to enhance its natural flavors, making it an ideal addition to your favorite dishes or as a standalone snack. Packed with essential nutrients, our panla fish is perfect for health-conscious consumers looking for a delicious and convenient source of protein. Enjoy the authentic taste of tradition with every bite!\r\n\r\n', '671ca250ca4b0.jpg', 0, 30000, ' ₦15,000 -  ₦60,000', NULL, 49, 'Panla Fish ', 'Panla fish, eja kika, Panla kika', 'Experience the rich, savory flavor of our oven-dried panla fish, expertly prepared for the perfect balance of taste and texture. Each fish is carefully selected and dried to enhance its natural flavors, making it an ideal addition to your favorite dishes or as a standalone snack. Packed with essential nutrients, our panla fish is perfect for health-conscious consumers looking for a delicious and convenient source of protein. Enjoy the authentic taste of tradition with every bite!\r\n', 'Support Services', 0, 0, 0, '2024-10-26 09:03:28'),
(46, 8, 'Blended Crayfish ', '6724f48284325-blended-crayfish', '200g JAR ', 'Enhance your meals with the rich, savory taste of our Blended Crayfish. Perfect for soups, stews, and sauces, this premium ingredient adds depth and authenticity to your favorite dishes. Ideal for everyday cooking.', '6724f4828438d.jpg', 0, 3500, '', NULL, 50, 'Blended crayfish ', 'Crayfish Powder, blended crayfish ', '**Blended Crayfish**\r\n\r\nEnhance your meals with the rich, savory taste of our Blended Crayfish. Perfect for soups, stews, and sauces, this premium ingredient adds depth and authenticity to your favorite dishes. Ideal for everyday cooking.', 'Support Services', 0, 0, 0, '2024-11-01 16:31:18'),
(47, 2, 'Premium Cow Slot', '6724f7c8794b0-premium-cow-slot', '¼ Share of Whole Cow ', 'Experience the quality and flavor of premium beef with our Quarter Share of a Whole Cow package. Perfect for families or meat enthusiasts, this package provides a variety of cuts including steaks, roasts, and ground beef, all sourced from responsibly-raised cattle. Enjoy the convenience of having a substantial supply of high-quality beef delivered straight to your door, ready to be cooked and savored in your favorite recipes.', '6724f7c87956f.png', 0, 112500, '', 'DMY-611jlrc0qbcc8jfa2ecnooilegcip', 50, 'Cow meat', 'Agemawo Cow meat', 'Experience the quality and flavor of premium beef with our Quarter Share of a Whole Cow package. Perfect for families or meat enthusiasts, this package provides a variety of cuts including steaks, roasts, and ground beef, all sourced from responsibly-raised cattle. Enjoy the convenience of having a substantial supply of high-quality beef delivered straight to your door, ready to be cooked and savored in your favorite recipes.', 'Support Services', 0, 0, 0, '2024-11-01 16:46:16'),
(48, 2, 'Ram Meat sharing ', '6724f8cac4fc9-ram-meat-sharing', 'All part inclusives, Cut with skin', 'Enjoy the rich flavor of our premium Ram Meat Sharing package. Perfect for family gatherings or special occasions, our tender, high-quality ram meat is sure to impress. Share delicious moments with loved ones and savor every bite!', '6724f8cac5127.png', 0, 75000, ' ₦18,800 -  ₦75,000', 'DMY-244jlrc0qbcc8jfa2ecnooilegcip', 50, 'Ram meat ', 'Ram meat ', 'Enjoy the rich flavor of our premium Ram Meat Sharing package. Perfect for family gatherings or special occasions, our tender, high-quality ram meat is sure to impress. Share delicious moments with loved ones and savor every bite!', 'Support Services', 0, 0, 0, '2024-11-01 16:50:34');
